class Automovil(mesa.Agent):
  '''
  Tiene el objetivo de llegar de un punto A a un punto B en el menor tiempo 
  posible.
  '''
  CAR_LENGTH = 5.2 # 5.2 metros

  class Orientation(enum.Enum):
   North = 1
   South = 2
   East = 3
   West = 4

  class Estado(enum.Enum):
    TransitandoCalle = 1
    CruzandoInterseccion = 2
    EnDestino = 3

  def __init__(self, unique_id, B, orientation, B_orientation, model):
    super().__init__(unique_id, model)
    # Para hacer más realista la simulación, habrá coches más lentos y más
    # rápidos. Esta velocidad está en m/s.
    self.MAX_SPEED = random.uniform(5, 22)
    self.B = B
    self.speed = 0.0 # la velocidad actual del coche. En m/s.
    self.orientation = orientation
    self.B_orientation = B_orientation
    self.estado = Automovil.Estado.TransitandoCalle
    # La orientación en la que el auto terminará después del giro/intersección
    self.orientacion_after_giro = None
    # El punto donde tendrá que hacerse en la intersección que tiene en frente
    self.punto_interseccion = None

  def step(self):
    if self.estado == Automovil.Estado.TransitandoCalle:
      self._transitando_calle()
    elif self.estado == Automovil.Estado.CruzandoInterseccion:
      self._cruzando_interseccion()
    elif self.estado == Automovil.Estado.EnDestino:
      pass

  # Helper function that will execute on the step if the state is
  # TransitandoCalle
  def _transitando_calle(self):
    if self.orientacion_after_giro == None:
      self.punto_interseccion, self.orientacion_after_giro = \
      self.model.waze.get_next_turn(self.pos, self.orientation, self.B,
                                    self.B_orientation)
      
    # Miramos que no hayamos llegado ya al destino
    x_distance = abs(self.pos[0] - self.B[0])
    y_distance = abs(self.pos[1] - self.B[1])
    in_same_x = x_distance < 1
    in_same_y = y_distance < 1
    if in_same_x:
      if y_distance < (self.speed + 1):
        self.estado = self.Estado.EnDestino
        self.speed = 0
        return
    elif in_same_y:
      if x_distance < (self.speed + 1):
        self.estado = self.Estado.EnDestino
        self.speed = 0
        return

    # Por prevención nada más
    min_x = -1.6
    max_x = self.model.width + 1.6
    min_y = -1.6
    max_y = self.model.height + 1.6
    if self.pos[0] > max_x or self.pos[1] > max_y or self.pos[0] < min_x or \
    self.pos[1] < min_y:
      self.estado = self.Estado.EnDestino
      self.speed = 0
      return


    acceleration = random.uniform(0.5, 4) # en m/s^2
    next_speed = self.speed + acceleration
    if next_speed > self.MAX_SPEED:
      next_speed = self.MAX_SPEED
    
    closest_dangerous_neighbor = \
                              self._get_closest_dangerous_neighbor(next_speed)
    if closest_dangerous_neighbor == None:
      self.speed = next_speed
    elif isinstance(closest_dangerous_neighbor, Automovil):
      self.speed = self.model.grid.get_distance(self.pos, 
                                              closest_dangerous_neighbor.pos)
      self.speed -= Automovil.CAR_LENGTH * 1.5
      self.speed = max(0, min(self.speed, next_speed))
    elif isinstance(closest_dangerous_neighbor, Semaforos):
      if closest_dangerous_neighbor.is_green_for_me(self.pos, Automovil.CAR_LENGTH):
        # distancia al punto por el que tendremos que pasar en la intersección
        distance_to_point = self.model.grid.get_distance(self.pos,
                                                    self.punto_interseccion)
        if distance_to_point > next_speed:
          self.speed = next_speed
        else:
          self.model.grid.move_agent(self, self.punto_interseccion)
          self.estado = self.Estado.CruzandoInterseccion
      else:
        self.speed = self.model.grid.get_distance(self.pos,
                                            closest_dangerous_neighbor.pos)
        self.speed -= 4 + Automovil.CAR_LENGTH * 0.5
        self.speed = max(0, min(self.speed, next_speed))

    if self.estado == self.Estado.TransitandoCalle: 
      self._advance_by_speed(self.speed)

  # Helper function that will execute on the step if the state is
  # CruzandoInterseccion
  def _cruzando_interseccion(self):
    self.speed = random.uniform(4.5, min(self.MAX_SPEED, 8.5))
    new_pos = self._get_new_position_after_turning(self.orientation,
                                                    self.orientacion_after_giro)
    self.model.grid.move_agent(self, new_pos)
    self.orientation = self.orientacion_after_giro
    self.orientacion_after_giro = None
    self.punto_interseccion = None
    self.estado = self.Estado.TransitandoCalle

  # Helper function to get closest dangerous neighbor
  def _get_closest_dangerous_neighbor(self, next_speed):
    neighbors = \
      self.model.grid.get_neighbors(self.pos, 
                                    Automovil.CAR_LENGTH * 1.5 + 20, 
                                    False)

    closest_dangerous_neighbor = None
    for neighbor in neighbors:
      # En el caso de que sea un coche en sentido contrario, no es relevante
      # (es imposible chocar con él, ya que cada uno va por su carril).
      # También, cada coche se preocupa solo por lo que tenga adelante,
      # ya que asumimos que los de atrás "sabrán comportarse"
      # print(self.unique_id, neighbor.unique_id if closest_dangerous_neighbor != None else "None")
      is_car = isinstance(neighbor, Automovil)
      diff_orientation = is_car and neighbor.orientation != self.orientation
      arrived = is_car and neighbor.estado == Automovil.Estado.EnDestino
      behind_me = self._is_behind_me(neighbor.pos)
      if not ((is_car and (diff_orientation or arrived)) or behind_me):
        if (neighbor != self) and (closest_dangerous_neighbor == None or \
        self.model.grid.get_distance(self.pos, neighbor.pos) < \
        self.model.grid.get_distance(self.pos,closest_dangerous_neighbor.pos)):
            closest_dangerous_neighbor = neighbor

    return closest_dangerous_neighbor

  # Helper function to get a new position after turning
  def _get_new_position_after_turning(self, orient_before, orient_after):
    if orient_before == Automovil.Orientation.West:
      if orient_after == Automovil.Orientation.West:
        return (self.pos[0] - 5, self.pos[1])
      elif orient_after == Automovil.Orientation.East:
        return (self.pos[0] + 5, self.pos[1] - 1.5)
      elif orient_after == Automovil.Orientation.South:
        return (self.pos[0] - 1.5, self.pos[1] - 5)
      elif orient_after == Automovil.Orientation.North:
        return (self.pos[0], self.pos[1] + 5)
    elif orient_before == Automovil.Orientation.East:
      if orient_after == Automovil.Orientation.West:
        return (self.pos[0] - 5, self.pos[1] + 1.5)
      elif orient_after == Automovil.Orientation.East:
        return (self.pos[0] + 5, self.pos[1])
      elif orient_after == Automovil.Orientation.South:
        return (self.pos[0], self.pos[1] - 5)
      elif orient_after == Automovil.Orientation.North:
        return (self.pos[0] + 1.5, self.pos[1] + 5)
    elif orient_before == Automovil.Orientation.South:
      if orient_after == Automovil.Orientation.West:
        return (self.pos[0] - 5, self.pos[1])
      elif orient_after == Automovil.Orientation.East:
        return (self.pos[0] + 5, self.pos[1] - 1.5)
      elif orient_after == Automovil.Orientation.South:
        return (self.pos[0], self.pos[1] - 5)
      elif orient_after == Automovil.Orientation.North:
        return (self.pos[0] + 1.5, self.pos[1] + 5)
    elif orient_before == Automovil.Orientation.North:
      if orient_after == Automovil.Orientation.West:
        return (self.pos[0] - 5, self.pos[1] + 1.5)
      elif orient_after == Automovil.Orientation.East:
        return (self.pos[0] + 5, self.pos[1])
      elif orient_after == Automovil.Orientation.South:
        return (self.pos[0] - 1.5, self.pos[1] - 5)
      elif orient_after == Automovil.Orientation.North:
        return (self.pos[0], self.pos[1] + 5)
    
  
  # helper function to see if the passed position is behind this car 
  def _is_behind_me(self, neighbor_pos):
    try:
      if self.orientation == Automovil.Orientation.North:
        return self.pos[1] > neighbor_pos[1]
      if self.orientation == Automovil.Orientation.South:
        return self.pos[1] < neighbor_pos[1]
      if self.orientation == Automovil.Orientation.East:
        return self.pos[0] > neighbor_pos[0]
      if self.orientation == Automovil.Orientation.West:
        return self.pos[0] < neighbor_pos[0]
    except:
      return True # workaround por un bug de Mesa.

  # helper function to advance the car x meters
  def _advance_by_speed(self, x):
    try:
      if self.orientation == Automovil.Orientation.North:
        self.model.grid.move_agent(self, (self.pos[0], self.pos[1] + x))
      if self.orientation == Automovil.Orientation.South:
        self.model.grid.move_agent(self, (self.pos[0], self.pos[1] - x))
      if self.orientation == Automovil.Orientation.East:
        self.model.grid.move_agent(self, (self.pos[0] + x, self.pos[1]))
      if self.orientation == Automovil.Orientation.West:
        self.model.grid.move_agent(self, (self.pos[0] - x, self.pos[1]))
    except: # si el carro se va "out of bounds", significa que llegó a su destino.
      self.estado = self.Estado.EnDestino
      self.speed = 0
      return


class Waze(mesa.Agent):
  '''
  Sabe cuánto tiempo en promedio se está demorando un auto de un nodo a otro,
  y con base a esto, es capaz de proveer a los automóviles con la ruta más
  rápida.
  Contiene el grafo dirigido que representa la ciudad, cuyos nodos son las
  intersecciones y aristas las calles. Los node_ids pueden ser las coordenadas
  de cada intersección. Debe pasarse un arreglo con todos los ids, en el mismo
  orden que aparece cada nodo en la matriz de adyacencia.
  INF es el número que se utilizó en adj_matrix para representar que no hay
  camino entre dos nodos.
  '''
  def __init__(self, model, node_ids, adj_matrix, INF, edge_distance):
    super().__init__("Waze", model)
    self.node_ids = node_ids
    self.node_id_to_idx = {id: idx for idx, id in enumerate(node_ids)}
    self.edge_distance = edge_distance
    # VARIABLES RELACIONADAS CON FLOYD-WARSHALL -------------------------------|
    self.adj_matrix = adj_matrix
    self.V = len(node_ids)
    self.INF = INF
    self.dis = [[-1 for i in range(self.V)] for i in range(self.V)]
    self.next = [[-1 for i in range(self.V)] for i in range(self.V)]
    # -------------------------------------------------------------------------|
    self._update_global_graph()
  
  # Esta función se llama cuando un auto quiere reportar cuánto se demoró
  # de nodo A a nodo B.
  def report_time_taken(self, A_node, B_node, t):
    A_idx = self.node_id_to_idx[A_node]
    B_idx = self.node_id_to_idx[B_node]
    self.adj_matrix[A_idx][B_idx] = self.adj_matrix[A_idx][B_idx]*0.4 + t*0.6
    self._update_global_graph()

  # Esta función la llama un carro cuando necesita saber para dónde girar
  # en la intersección que tiene adelante.
  # Devuelve una tupla con el punto en el que tendrá que estar dentro de la 
  # intersección (ver FIGURA 2), y la nueva orientación después del giro.
  def get_next_turn(self, car_pos, car_orientation, B, B_orientation):
    node_pos = self._get_future_node(car_pos, car_orientation, 
                                            self.edge_distance)
    # Esto podría optimizarse llamándose solo una vez:
    B_node_pos = self._get_future_node(B, B_orientation, self.edge_distance)
    if B_node_pos == None:
      B_node_pos = self._get_node_after_destination(node_pos, B, 
                                                    self.edge_distance)
    next_node_pos = self._get_next_node_pos(node_pos, B_node_pos)

    new_orientation = None
    if node_pos[0] - next_node_pos[0] > 1: # siguiente nodo a la izquierda
      new_orientation = Automovil.Orientation.West
    elif next_node_pos[0] - node_pos[0] > 1: # siguiente nodo a la derecha
      new_orientation = Automovil.Orientation.East
    elif node_pos[1] - next_node_pos[1] > 1: # siguiente nodo atrás
      new_orientation = Automovil.Orientation.South
    elif next_node_pos[1] - node_pos[1] > 1: # siguiente nodo adelante
      new_orientation = Automovil.Orientation.North

    punto_interseccion = None
    if car_orientation == Automovil.Orientation.West:
      if new_orientation == Automovil.Orientation.West:
        punto_interseccion = (node_pos[0], node_pos[1] + 1.5)
      elif new_orientation == Automovil.Orientation.East:
        punto_interseccion = (node_pos[0], node_pos[1])
      elif new_orientation == Automovil.Orientation.South:
        punto_interseccion = (node_pos[0], node_pos[1])
      elif new_orientation == Automovil.Orientation.North:
        punto_interseccion = (node_pos[0] + 1.5, node_pos[1] + 1.5)
    elif car_orientation == Automovil.Orientation.East:
      if new_orientation == Automovil.Orientation.West:
        punto_interseccion = (node_pos[0], node_pos[1])
      elif new_orientation == Automovil.Orientation.East:
        punto_interseccion = (node_pos[0], node_pos[1] - 1.5)
      elif new_orientation == Automovil.Orientation.South:
        punto_interseccion = (node_pos[0] - 1.5, node_pos[1] - 1.5)
      elif new_orientation == Automovil.Orientation.North:
        punto_interseccion = (node_pos[0], node_pos[1])
    elif car_orientation == Automovil.Orientation.South:
      if new_orientation == Automovil.Orientation.West:
        punto_interseccion = (node_pos[0] - 1.5, node_pos[1] + 1.5)
      elif new_orientation == Automovil.Orientation.East:
        punto_interseccion = (node_pos[0], node_pos[1])
      elif new_orientation == Automovil.Orientation.South:
        punto_interseccion = (node_pos[0] - 1.5, node_pos[1])
      elif new_orientation == Automovil.Orientation.North:
        punto_interseccion = (node_pos[0], node_pos[1])
    elif car_orientation == Automovil.Orientation.North:
      if new_orientation == Automovil.Orientation.West:
        punto_interseccion = (node_pos[0], node_pos[1])
      elif new_orientation == Automovil.Orientation.East:
        punto_interseccion = (node_pos[0] + 1.5, node_pos[1] - 1.5)
      elif new_orientation == Automovil.Orientation.South:
        punto_interseccion = (node_pos[0], node_pos[1])
      elif new_orientation == Automovil.Orientation.North:
        punto_interseccion = (node_pos[0] + 1.5, node_pos[1])

    return (punto_interseccion, new_orientation)


  # Esta función se llama internamente para saber a qué nodo moverse
  # después del nodo al que se dirige. B es el nodo destino final.
  # Devuelve la posición del nodo.
  def _get_next_node_pos(self, current_node, B_node):
    current_idx = self.node_id_to_idx[current_node]
    B_idx = self.node_id_to_idx[B_node]
    next_node = self.next[current_idx][B_idx]
    return self.node_ids[next_node] # recordar que el id es la posición.

  # Esta función se llama internamente para saber a qué nodo se está dirigiendo 
  # un carro
  def _get_future_node(self, car_pos, car_orientacion, edge_distance):
    neighbors = self.model.grid.get_neighbors(car_pos, edge_distance, False)
    for neighbor in neighbors:
      if isinstance(neighbor, Semaforos):
        if car_orientacion == Automovil.Orientation.North:
          if neighbor.pos[1] > car_pos[1] and \
          abs(neighbor.pos[0] - car_pos[0]) < 3:
            return neighbor.unique_id
        elif car_orientacion == Automovil.Orientation.South:
          if neighbor.pos[1] < car_pos[1] and \
          abs(neighbor.pos[0] - car_pos[0]) < 3:
            return neighbor.unique_id
        elif car_orientacion == Automovil.Orientation.East:
          if neighbor.pos[0] > car_pos[0] and \
          abs(neighbor.pos[1] - car_pos[1]) < 3:
            return neighbor.unique_id
        elif car_orientacion == Automovil.Orientation.West:
          if neighbor.pos[0] < car_pos[0] and \
          abs(neighbor.pos[1] - car_pos[1]) < 3:
            return neighbor.unique_id

  # Para el caso en el que llegamos al nodo destino, pero no al destino como tal
  # (necesitamos un nuevo nodo destino, eso es lo que devolvemos)
  def _get_node_after_destination(self, current_node_pos, B, edge_distance):
    # if big and positive, go west. If big and negative, go east.
    x_difference = current_node_pos[0] - B[0]
    # if big and positive, go south. If big and negative, go north.
    y_difference = current_node_pos[1] - B[1]

    search_in_pos = None
    if abs(x_difference) > abs(y_difference):
      if x_difference > 0:
        search_in_pos = (current_node_pos[0]-edge_distance, current_node_pos[1])
      elif x_difference < 0:
        search_in_pos = (current_node_pos[0]+edge_distance, current_node_pos[1])
    else:
      if y_difference > 0:
        search_in_pos = (current_node_pos[0], current_node_pos[1]-edge_distance)
      elif y_difference < 0:
        search_in_pos = (current_node_pos[0], current_node_pos[1]+edge_distance)

    neighbors = self.model.grid.get_neighbors(search_in_pos, 1, True)
    for neighbor in neighbors:
      if isinstance(neighbor, Semaforos):
        return neighbor.unique_id

    print(current_node_pos, search_in_pos, B)
    

  # Llama a Floyd-Warshall para actualizar la información
  def _update_global_graph(self):
    initialise(self.V, self.INF, self.adj_matrix, self.dis, self.next)
    floydWarshall(self.V, self.INF, self.dis, self.next)

class Semaforos(mesa.Agent):
  '''
  Este agente representa a los cuatro semáforos de una intersección.
  Cambian de color cuando pasan t segundos o cuando hay x o más coches
  esperando de un lado de la intersección. 
  '''
  class Color(enum.Enum):
    Rojo = 0
    Amarillo = 1
    Verde = 2

  class Estado(enum.Enum):
    TodosRojos = 0
    AmarilloYRojo = 1
    VerdeYRojo = 2
  
  def __init__(self, unique_id, model, edge_length, t=15, x=5):
    super().__init__(unique_id, model)
    self.t = t
    self.x = x
    self.timer = 0
    self.edge_length = edge_length
    self.estado = self.Estado.VerdeYRojo
    horizontal_rojo = random.randint(0, 1)
    if horizontal_rojo:
      self.color_horizontal = self.Color.Rojo
      self.color_vertical = self.Color.Verde
    else:
      self.color_horizontal = self.Color.Verde
      self.color_vertical = self.Color.Rojo

  # Devuelve si, para la posición (de un auto) pasada como argumento, este 
  # semáforo está en verde. También asumiremos que "está en verde" si ya 
  # estamos dentro de la intersección, y lo más prudente es salir de ella,
  # por más que no esté en verde.
  def is_green_for_me(self, auto_pos, car_length):
    horizontal_dist = abs(self.pos[0] - auto_pos[0])
    vertical_dist = abs(self.pos[1] - auto_pos[1])
    if horizontal_dist > vertical_dist:
      return self.color_horizontal == self.Color.Verde or \
             horizontal_dist < 3 + car_length / 2
    else:
      return self.color_vertical == self.Color.Verde or \
             vertical_dist < 3 + car_length / 2


  def step(self):
    self.timer += 1

    if self._get_waiting_cars() >= self.x and self.timer >= 5 and \
    self.estado == self.Estado.VerdeYRojo:
      self.timer = self.t
    
    if self.estado == self.Estado.VerdeYRojo and self.timer % self.t == 0:
      self.timer = 0
      self.estado = self.Estado.AmarilloYRojo
      self.prox_color_horizontal = self.color_vertical
      self.prox_color_vertical = self.color_horizontal
      if self.color_horizontal == self.Color.Verde:
        self.color_horizontal = self.Color.Amarillo
      if self.color_vertical == self.Color.Verde:
        self.color_vertical = self.Color.Amarillo
    elif self.estado == self.Estado.AmarilloYRojo and self.timer % 1 == 0:
      self.timer = 0
      self.estado = self.Estado.TodosRojos
      self.color_horizontal = self.Color.Rojo
      self.color_vertical = self.Color.Rojo
    elif self.estado == self.Estado.TodosRojos and self.timer >= 1:
      self.timer = 0
      self.estado = self.Estado.VerdeYRojo
      self.color_horizontal = self.prox_color_horizontal
      self.color_vertical = self.prox_color_vertical
      
  # Returns cars waiting at red light when another light is green
  def _get_waiting_cars(self):
    count = 0
    neighbors = self.model.grid.get_neighbors(self.pos, self.edge_length/6, 
                                              False)
    
    if self.color_horizontal == self.Color.Rojo and \
    self.color_vertical == self.Color.Verde:
      for neighbor in neighbors:
        if isinstance(neighbor, Automovil):
          if abs(self.pos[0] - neighbor.pos[0]) > 3:
            if self._is_car_looking_at_me(neighbor.pos, neighbor.orientation):
              count += 1
    elif self.color_horizontal == self.Color.Verde and \
    self.color_vertical == self.Color.Rojo:
      for neighbor in neighbors:
        if isinstance(neighbor, Automovil):
          if abs(self.pos[1] - neighbor.pos[1]) > 3:
            if self._is_car_looking_at_me(neighbor.pos, neighbor.orientation):
              count += 1

    return count

  # Returns cars passing through segments of road/intersecti. with green light
  def _get_passing_cars(self):
    count = 0
    neighbors = self.model.grid.get_neighbors(self.pos, self.edge_length/6,
                                              True)
    if self.color_horizontal == self.Color.Rojo and \
    self.color_vertical == self.Color.Verde:
      for neighbor in neighbors:
        if isinstance(neighbor, Automovil):
          if abs(self.pos[1] - neighbor.pos[1]) > 3:
            if self._is_car_looking_at_me(neighbor.pos, neighbor.orientation):
              count += 1
    elif self.color_horizontal == self.Color.Verde and \
    self.color_vertical == self.Color.Rojo:
      for neighbor in neighbors:
        if isinstance(neighbor, Automovil):
          if abs(self.pos[0] - neighbor.pos[0]) > 3:
            if self._is_car_looking_at_me(neighbor.pos, neighbor.orientation):
              count += 1

  # returns if the passed car is looking at this traffic light (car orientation)
  def _is_car_looking_at_me(self, car_pos, car_orient):
    if car_orient == Automovil.Orientation.West:
      return self.pos[0] < car_pos[0]
    elif car_orient == Automovil.Orientation.East:
      return self.pos[0] > car_pos[0]
    elif car_orient == Automovil.Orientation.North:
      return self.pos[1] > car_pos[1]
    elif car_orient == Automovil.Orientation.South:
      return self.pos[1] < car_pos[1]

class Ciudad(mesa.Model):
  '''
  Representación de la ciudad. Cada unidad del espacio representa 1 metro.
  n es la cantidad de automóviles que habrá en la ciudad.
  '''
  def __init__(self, width, height, n):
    # Es un ContinuousSpace para no estar limitados por la cuadrícula
    self.grid = mesa.space.ContinuousSpace(width+2, height+2, False, -2, -2)
    self.width = width
    self.height = height
    self.schedule = mesa.time.RandomActivation(self) # de momento.
    self.EDGE_DISTANCE = 51 # en metros, la distancia entre nodos
    self.jsons = [] # donde guardaremos los jsons de cada segundo


    # Instanciar las intersecciones/semáforos/nodos y la matriz de adyacencia 
    # para Waze
    node_ids = []
    INF = 10**7
    N = width//self.EDGE_DISTANCE + 1 # cantidad de nodos por línea/columna
    V = N**2 # cantidad de nodos total
    for y in range(0, width+1, self.EDGE_DISTANCE):
      for x in range(0, height+1, self.EDGE_DISTANCE):
        semaforos = Semaforos((x, y), self, self.EDGE_DISTANCE)
        self.schedule.add(semaforos)
        self.grid.place_agent(semaforos, (x, y))
        node_ids.append((x, y))

    # Llenamos la matriz de adyacencia inicial para el Waze
    adj_matrix = [[INF]*V for i in range(V)]
    DEFAULT_WEIGHT = 20
    adj_matrix[0][1] = 2
    for node_idx in range(V):
      if node_idx+N < V: # si tiene un nodo arriba
        adj_matrix[node_idx][node_idx+N] = DEFAULT_WEIGHT
      if node_idx-N >= 0: # si tiene un nodo abajo
        adj_matrix[node_idx][node_idx-N] = DEFAULT_WEIGHT
      if node_idx // N == (node_idx + 1) // N: # si tiene un nodo a la derecha
        adj_matrix[node_idx][node_idx+1] = DEFAULT_WEIGHT
      if node_idx // N == (node_idx - 1) // N: # si tiene un nodo a la izquierda
        adj_matrix[node_idx][node_idx-1] = DEFAULT_WEIGHT

    # Inicializar Waze
    self.waze = Waze(self, node_ids, adj_matrix, INF, self.EDGE_DISTANCE)


    # Instanciar los automóviles
    for i in range(n):
      Ax = None
      Ay = None
      Bx = None
      By = None
      # Alinearlos a la carretera y establecer su orientación
      valid_instantiation_coords = False
      while not valid_instantiation_coords:
        Ax = random.uniform(0, width+self.EDGE_DISTANCE)
        Ay = random.uniform(0, height+self.EDGE_DISTANCE)
        Bx = random.uniform(0, width+self.EDGE_DISTANCE)
        By = random.uniform(0, height+self.EDGE_DISTANCE)
        clipAHorizontally = random.randint(0, 1)
        clipBHorizontally = random.randint(0, 1)
        orientation = None
        B_orientation = None
        if clipAHorizontally:
          Ax = (Ax // (self.EDGE_DISTANCE)) * self.EDGE_DISTANCE
          if Ay > height:
            Ay = height
          orientation = random.choice([Automovil.Orientation.North, 
                                       Automovil.Orientation.South])
          Ax += 1.5 if orientation == Automovil.Orientation.North else -1.5
        else:
          Ay = (Ay // (self.EDGE_DISTANCE)) * self.EDGE_DISTANCE
          if Ax > width:
            Ax = width
          orientation = random.choice([Automovil.Orientation.East, 
                                       Automovil.Orientation.West])
          Ay += 1.5 if orientation == Automovil.Orientation.West else -1.5
        if clipBHorizontally:
          Bx = (Bx // (self.EDGE_DISTANCE)) * self.EDGE_DISTANCE
          if By > height:
            By = height
          B_orientation = random.choice([Automovil.Orientation.North, 
                                         Automovil.Orientation.South])
          Bx += 1.5 if B_orientation == Automovil.Orientation.North else -1.5
        else:
          By = (By // (self.EDGE_DISTANCE)) * self.EDGE_DISTANCE
          if Bx > width:
            Bx = width
          B_orientation = random.choice([Automovil.Orientation.East, 
                                         Automovil.Orientation.West])
          By += 1.5 if B_orientation == Automovil.Orientation.West else -1.5
        
        # Asegurarnos de que no salgan en intersecciones o encima uno de otro
        valid_instantiation_coords = True
        car_neighbors = self.grid.get_neighbors((Ax, Ay), 6, True)
        for neighbor in car_neighbors:
          if isinstance(neighbor, Automovil):
            if neighbor.orientation == orientation:
              valid_instantiation_coords = False
              break
          elif isinstance(neighbor, Semaforos):
            valid_instantiation_coords = False
            break
        destination_neighbors = self.grid.get_neighbors((Bx, By), 6, True)
        for neighbor in destination_neighbors:
          if isinstance(neighbor, Semaforos):
            valid_instantiation_coords = False
            break
      
      auto = Automovil(i, (Bx, By), orientation, B_orientation, self)
      # print(Bx, By)
      self.schedule.add(auto)
      self.grid.place_agent(auto, (Ax, Ay))



  def step(self):
    '''Avanza el modelo por 1 segundo'''
    self.schedule.step()
    # Guardar toda la información del modelo en un JSON:
    this_sec = {} # toda la información de un segundo determinado
    this_sec["car_info"] = []
    this_sec["intersection_info"] = []
    for agent in self.schedule.agents:
      if isinstance(agent, Automovil):
        this_car_info = {}
        this_car_info["id"] = agent.unique_id
        this_car_info["x"] = agent.pos[0]
        this_car_info["z"] = agent.pos[1]
        this_car_info["en_destino"] = agent.estado == agent.Estado.EnDestino
        this_car_info["en_interseccion"] = \
                              agent.estado == agent.Estado.CruzandoInterseccion
        this_car_info["orientacion"] = agent.orientation.value
        this_car_info["orientacion_after_giro"] = \
          agent.orientacion_after_giro if agent.orientacion_after_giro == None \
          else agent.orientacion_after_giro.value
        this_sec["car_info"].append(this_car_info)
      if isinstance(agent, Semaforos):
        this_intersection_info = {}
        this_intersection_info["id"] = agent.unique_id
        this_intersection_info["x"] = agent.pos[0]
        this_intersection_info["z"] = agent.pos[1]
        this_intersection_info["color_horizontal"] =agent.color_horizontal.value
        this_intersection_info["color_vertical"] =agent.color_vertical.value
        this_sec["intersection_info"].append(this_intersection_info)
    this_sec_json = json.dumps(this_sec)
    return this_sec_json


  def plot(self):
    x_coords = []
    y_coords = []
    hover_names = []
    symbols = []
    for agent in self.schedule.agents:
      x_coords.append(agent.pos[0])
      y_coords.append(agent.pos[1])
      if isinstance(agent, Automovil):
        hover_names.append(f"Car #{agent.unique_id}")
        if agent.estado != Automovil.Estado.EnDestino:
          symbols.append(f'{agent.orientation.name} Car')
        else:
          symbols.append(f'Arrived Car')
      if isinstance(agent, Semaforos):
        hover_names.append(f"Intersección con semáforos/Nodo")
        if agent.estado == agent.Estado.TodosRojos:
          symbols.append('NodoTodosRojos')
        elif agent.estado == agent.Estado.AmarilloYRojo:
          if agent.color_horizontal == agent.Color.Amarillo:
            symbols.append('NodoHorizontalAmarillo')
          elif agent.color_vertical == agent.Color.Amarillo:
            symbols.append('NodoVerticalAmarillo')
        elif agent.estado == agent.Estado.VerdeYRojo:
          if agent.color_horizontal == agent.Color.Verde:
            symbols.append('NodoHorizontalVerde')
          elif agent.color_vertical == agent.Color.Verde:
            symbols.append('NodoVerticalVerde')
          
    fig = plt.scatter(x=x_coords, y=y_coords, hover_name=hover_names,
                      symbol=symbols, 
                      symbol_map={"North Car": 'triangle-up',
                                  "South Car": 'triangle-down',
                                  "West Car": 'triangle-left',
                                  "East Car": 'triangle-right',
                                  "Arrived Car": 'circle-open',
                                  "NodoTodosRojos": 'circle-open-dot',
                                  "NodoHorizontalAmarillo": 'line-ew-open',
                                  "NodoVerticalAmarillo": 'line-ns-open',
                                  "NodoHorizontalVerde": 'line-ew-open',
                                  "NodoVerticalVerde": 'line-ns-open'},
                      color=symbols, 
                      color_discrete_map={"North Car": 'black',
                                          "South Car": 'black',
                                          "West Car": 'black',
                                          "East Car": 'black',
                                          "Arrived Car": 'black',
                                          "NodoTodosRojos": 'red',
                                      "NodoHorizontalAmarillo": 'darkorange',
                                      "NodoVerticalAmarillo": 'darkorange',
                                      "NodoHorizontalVerde": 'green',
                                      "NodoVerticalVerde": 'green'})
    # for the x, y, and z axes to have the same scale
    fig.update_yaxes(scaleanchor="x", scaleratio=1)
    return fig


